import axiosCsrf from "../../Module/interceptor/axiosCsrfInterceptor";

const testGet = () => {
    axiosCsrf.get("/test").then((resp) => {
        console.log(resp);
    })
}

const testPost = () => {
    axiosCsrf.post("/test").then((resp) => {
        console.log(resp);
    })
}

const logout = () => {
    axiosCsrf.post("/oauth2/logout").then((resp) => {
        // window.location.assign("/");
        console.log(resp);
    });
}

export default function SignUp() {

    return (
        <main style={{ padding: "1rem 0" }}>
            <h2>SignUp</h2>
            <button onClick={logout}>Logout</button>
            <button onClick={testGet}>testGet</button>
            <button onClick={testPost}>testPost</button>
        </main>
    );
}
